      <h2 className='pop'>Popular Topics</h2>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              text='..........'
            />
            <CardItem
              text='.......' 
            />
            <CardItem
              text='......'
            />
          </ul>
        </div>
      </div>
      <h3 className='Rec'>Recomanded for you</h3>
    </div>
  );
}

export default Cards2;
